import React, { Component } from 'react';



class App extends Component {
  render() {
    return (
      <div>
        <h2>Design is my life</h2>
        <p>Grapic and web design are far more than a job</p>
        <ul>
          <li>facebook</li>
          <li>Twitter</li>
          <li>Instagram</li>
        </ul>
      </div>
    );
  }
}

export default App;
